import React from "react";

const Footer = () => {
  return (
    <footer className="self-stretch h-[99px] bg-white overflow-hidden shrink-0 flex flex-row items-center justify-center py-[22px] pr-[95px] pl-[43px] box-border gap-[20px] top-[0] z-[99] sticky max-w-full text-left text-21xl text-darkslategray-100 font-open-sans mq450:pr-5 mq450:box-border mq750:pl-[21px] mq750:pr-[47px] mq750:box-border">
      <div className="self-stretch flex flex-row items-center justify-start gap-[9px]">
        Footer
      </div>
    </footer>
  );
};

export default Footer;
